data:
  definition: contenu d'un document, sous forme d'écrit, d'imprimé ou d'images fixes,
    confié à un service télégraphique en vue de sa transmission et de sa remise au
    destinataire
  examples: []
  notes:
  - Le télégramme désigne aussi le document remis au service télégraphique ou au destinataire.
